import React from 'react'

class ContactNav extends React.Component{
    render(){
        return(
            <form>
                <input type='text' placeholder='Search' />
                <button>Add Contact</button>
                <button>Export Contacts</button>
            </form>
        )
    }
}

export default ContactNav
